/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-avatar-root">	${ context.image ? block1(context) : block2(context) }</div>`; };
const block1 = (context) => { return html`<span class="ui5-avatar-img" style="background-image: url(${ifDefined(context.image)})" role="img" aria-label="${ifDefined(context.accessibleNameText)}"></span>	`; };
const block2 = (context) => { return html`${ context.icon ? block3(context) : block4(context) }`; };
const block3 = (context) => { return html`<ui5-icon class="ui5-avatar-icon" name="${ifDefined(context.icon)}" accessible-name="${ifDefined(context.accessibleNameText)}"></ui5-icon>	`; };
const block4 = (context) => { return html`${ context.initials ? block5(context) : undefined }`; };
const block5 = (context) => { return html`<span class="ui5-avatar-initials">${ifDefined(context.validInitials)}</span>	`; };

export default block0;
